function getVideos(value) {
    var fileNames = value.split("\n");
    var videoResults = document.getElementById("video-results");
    videoResults.innerHTML = "";
    videoResults.innerHTML += "{{YouTubeGallery|\n";
    fileNames.forEach(function(fileName) {
        var found = false;
        if (fileName) {
            Object.entries(videoFiles).forEach(function([videoId, videoFileName]) {
                const [name, ...description] = fileName.trim().split('|');
                if (videoFileName === name.replace(/ /g, '_')) {
                    videoResults.innerHTML += `{{YouTube|id=${videoId}|name=${videoTitles[videoId]?.replace(/\|/g, '{{!}}') ?? name}${description.length > 0 ? `|description=${description.join('|')}` : ''}}}\n`;
                    found = true;
                    return;
                }
            });
        }
        if (!found) {
            videoResults.innerHTML += `<!-- Couldn't find ${fileName}-->\n`;
        }
    });
    videoResults.innerHTML += "}}";
}
